import React from 'react';
import {BrowserRouter,Route} from 'react-router-dom'
import Navbar from './components/navbar'
import Home from './slides/Home';

function App() {
  return (
    <BrowserRouter>
   <div>
     <Navbar />
     <Route exact path="/" component={Home}>  </Route>
   </div>
   </BrowserRouter>
  );
}

export default App;
